import {VFC} from 'react';
import {BiMenu} from 'react-icons/bi';
import {FaMedium, FaTelegram, FaTwitter} from 'react-icons/fa';
import { Link } from 'react-router-dom';

export const WebsiteOverlay: VFC = () => {
    return <div className="flex flex-col absolute w-full h-full z-10 p-0 text-white">
        <div className="flex font-bold flex-col my-auto h-full max-w-[34rem] backdrop-brightness-0 p-4">
            <div className="uppercase text-8xl">LOADING...</div>
            <div className="uppercase text-5xl mb-6">APES VS. PROTOCOL</div>
            <div className="mb-6">Bilidly is a roll-out of Solidly protocol on Binance Smart Chain
            </div>
            <div className="flex text-3xl gap-8 mt-auto">
            <Link to="/any-url">
            <FaTwitter/>
            </Link>
            <FaMedium/>
            <FaTelegram/>
        </div>
        </div>
    </div>;
};
